pragma solidity ^0.8.28;

import "./SwapAbstract.sol";

abstract contract ExchangeAbstract is SwapAbstract {
    uint public nativePurchasableTime = block.timestamp;
    uint128 public immutable nativePurchasableRate;
    uint128 public immutable erc20Inhibitor;

    uint public erc20PurchasableTime = block.timestamp;
    uint128 public immutable erc20PurchasableRate;
    uint128 public immutable nativeInhibitor;

    constructor(
        uint128 nativePurchasableRate_, 
        uint128 erc20Inhibitor_, 
        uint128 erc20PurchasableRate_,
        uint128 nativeInhibitor_
    ) {
        nativePurchasableRate = nativePurchasableRate_;
        erc20Inhibitor = erc20Inhibitor_;
        erc20PurchasableRate = erc20PurchasableRate_;
        nativeInhibitor = nativeInhibitor_;
    }

    function purchasableNatives() public view returns (uint) {
        return (block.timestamp - nativePurchasableTime) * nativePurchasableRate;
    }

    function purchasableERC20s() public view returns (uint) {
        return (block.timestamp - erc20PurchasableTime) * erc20PurchasableRate;
    }

    function getERC20ToNativePrice(uint erc20sSold) public override view returns (uint nativesBought) {
        nativesBought = purchasableNatives() * erc20sSold / (erc20Inhibitor + erc20sSold);
        if(address(this).balance < nativesBought) {
            nativesBought = address(this).balance;
        }
    }

    function nativeToERC20Swap(SwapAbstract sa, uint natives, address receiver) external returns (uint earned) {
        uint startBalance = asset.balanceOf(address(this));
        sa.nativeToERC20Swap{value:natives}();
        uint assets = asset.balanceOf(address(this)) - startBalance;

        earned = getERC20ToNativePrice(assets) - natives;
        nativePurchasableTime += earned / nativePurchasableRate;
        
        (bool success,) = receiver.call{value:earned}("");
        require(success);
    }

    function erc20ToNativeSwap(SwapAbstract sa, uint erc20s, address receiver) external returns (uint earned) {
        uint startBalance = address(this).balance;
        asset.approve(address(sa),erc20s);
        sa.erc20ToNativeSwap(erc20s); // this can be anything really
        uint natives = address(this).balance - startBalance;

        earned = getNativeToERC20Price(natives) - erc20s;
        erc20PurchasableTime += earned / erc20PurchasableRate;

        asset.transfer(receiver, earned);
    }
}

